  [],\n\t\"revision_timestamp\": \"2014-04-24T15:02:52.860037\",\n\t\"name\": \"an-investigation-into-the-water-quality-of-long-lake-national-wildlife-refuge-burleigh-and\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Long Lake National Wildlife Refuge has
  a long history of severe botulism outbreaks killing as many as 50,000 birds in a
  single year. Water quality has been hypothesized as a factor leading to the onset
  of the disease. To study this issue, and to fulfill permit requirements of the North
  Dakota State Department of Health, sampling was performed to determine the water
  quality of Long Lake. Results indicate Long Lake has the chemical makeup of a typical
  saline prairie lake. Results also indicate that a permit to discharge Long Lake
  water would probably be obtainable if data collected when a permit application is
  made are consistent with results of this investigation.\",\n\t\"license_title\":
